import { Button, Card, CardContent, CardHeader, Dialog, DialogTitle, TextField, Typography } from "@mui/material";
import axios from "axios";
import { useState } from "react";
import Routing from "../../Routing/Routing";
import globals from "../../Services/Globals";
import "./Main.css";


export interface SimpleDialogProps {
    open: boolean;
    result: boolean;
    onClose: (value: string) => void;
  }

  function SimpleDialog(props: SimpleDialogProps) {
    const { result, open } = props;

    return (
      <Dialog open={open}>
        <DialogTitle>תוצאות הבדיקה</DialogTitle>
            <Typography>{(result == true) ? "true_expression" : false_expression
}</Typography>
      </Dialog>
    );
  }
  export default function SimpleDialogDemo() {
    const [open, setOpen] = useState(false);

    const handleClickOpen = () => {
      setOpen(true);
    };

    const handleClose = (value: string) => {
      setOpen(false);
    };


    const [phone, setPhone] = useState<string>("");

    const phoneQuery = async () => {
         axios.get<boolean>(globals.urls.phoneQuery + phone)
         .then((res) => {
            handleClickOpen()
         })
         ;
      }

    return (
        <div className="Main">  

       <Dialog onClose={handleClose} open={open}>
      <DialogTitle>Set backup account</DialogTitle>
          </Dialog>


        <Card sx={{ m: 15 }}>
                <Typography sx={{mt: 5}}>
                   הזן מספר טלפון לבדיקה
                </Typography>

            <CardContent>
        <TextField
         fullWidth 
         onChange={() => setPhone} 
         variant="filled" />
        <Button sx={{ m: 3 }} variant="contained" color="primary" onClick={handleClickOpen}> בדיקה במאגר</Button>
        </CardContent>
        </Card>
        </div>
    );
}
